import React, { Component } from 'react'
import { Header, Transition } from 'semantic-ui-react'

import { Arepa } from '@components/SVGIcons'

export default class gfg extends React.Component<{}, {
  visible: boolean, 
  onClick: () => void,
  onComplete:() => void}> {
  constructor(props: any) {
    super(props);

    this.state = {visible: true, onClick: this.gfg1};
  }

  gfg1 = () =>
    this.setState((btt) => ({ visible: !btt.visible }))

  render() {
    const { visible } = this.state

    return (
      <Header size="huge" as="h1" onClick={this.gfg1}>
    Are
    <Transition
      animation="jiggle"
      visible={visible}
      duration={900}
    >
      <Arepa size="58px" />
    </Transition>
    Passion
  </Header>
    )
  }
}
